(9902, '9902', 'Vendas', 'comercial', '', '', '', '', '', 101, 3, '', 'Uma pousada constituída por três prédios e outras benfeitorias na área rural de São Tomé das Letras, a 9km da cidade e próxima a vários pontos turísticos importantes, como as cachoeiras Véu da Noiva, Antares e Flávio.\r\n1º prédio com 12 suítes (35,00m² cada), onde uma possui cozinha integrada. Dessas, 4 com ar condicionado e 8 com ventilador. 2 salas de apoio e roupeiro. \r\nTem ainda sistema de aquecimento solar para os chuveiros e elétrico, com padrão de luz independente.\r\n2º prédio com cozinha industrial, salão de restaurante, quarto de apoio, banheiro, recepção e salão de jogos.\r\n3º prédio com 2 suítes prontas e 6 em fase de acabamento mais uma casa de apoio.\r\nPossui, ainda, uma área agro com pastagem, curral, cochos, galinheiro e estrutura para chiqueiro. Cozinha estilo rancho para uso comum.\r\nRio em grande parte da divisa e mina d’água; estacionamento amplo; piscina; pomar e internet.\r\n\r\n\r\n', 2800000, 0, 1, '', 1, '', 1, 0, 900, 42000, 0, 0, 0, 0, 0, '{\"28\":1,\"3\":1,\"38\":1}', '2023-05-12 13:08:08', '2024-01-25 17:41:01'),
