(10160, '10160', 'Vendas', 'casa', '', '', '', '', '', 5, 1, '', 'Um imóvel residencial com duas moradas, sendo: \r\n1ª casa: 02 quartos, 01 banheiro social, sala, cozinha, área de serviço, quintal e garagem com vaga coberta.\r\n2ª casa: 03 quartos (uma suíte), 02 banheiros sociais, cozinha, sala, área de serviço coberta e garagem para 03 carros. \r\n\r\n\r\n', 350000, 0, 1, 'foto-15-do-imovel-10160.jpeg', 1, '', 1, 0, 174, 240, 0, 5, 4, 1, 0, '[]', '2023-05-12 13:08:08', '2024-01-25 12:49:28'),
(10161, '10161', 'Vendas', 'casa', '', '', '', '', '', 175, 1, '', 'Imóvel com três moradas residenciais, mais um espaço coberto e toda murada. \r\n1ª casa: 02 quartos, um banheiro, sala, copa/cozinha, varanda e área de serviço.\r\n2ª casa: 01 quarto, sala, cozinha, banheiro, área de serviço e terraço.\r\n3ª casa: uma quarto, sala, cozinha, banheiro e quintal. \r\nMais uma área coberta ao nível da rua onde, atualmente, é utilizado como oficina de veículos.\r\n\r\n\r\n', 385000, 0, 1, 'foto-18-do-imovel-10161.jpeg', 1, '', 1, 0, 144, 360, 0, 4, 3, 0, 0, '[]', '2023-05-12 13:08:08', '2024-01-25 12:48:43'),
